La siguiente es una lista de los grupos étnicos en China, en donde se entiende por China a las zonas controladas por cualquiera de los dos estados conocidos como «China» en sus nombres oficiales, la República Popular China (RPC) y la República de China (Taiwán). El grupo étnico más grande son los han. El 91.59 % de la población china (1400 millones) fue clasificada como han. Además de la mayoría han, China reconoce a otros 55 grupos étnicos, que son alrededor de 105 millones de personas, en su mayoría concentrados en el noroeste, norte, noreste, sur y suroeste, pero con algunos asentamientos en el centro interior. En cuanto a la población de origen internacional o extranjera en China es prácticamente inexistente, representando tan solo el 0.49 % del total nacional (aproximadamente unos 657 000 habitantes, que representa el menor porcentaje de extranjeros sobre la población total en un país). La mayoría se concentra en la capital Pekín y en las zonas de Hong Kong y Taiwán. La población extranjera en China está integrada de la siguiente manera: 
* coreanos, mongoles, japoneses, rusos y kazajos: 60 % (394 200 habitantes); 
* otros europeos: 35 % (229 950 habitantes); 
* otras razas o nacionalidades: 5 % (32 850 habitantes).
